[[File:Compost detail.png|left|130px]]
'''Compost''' is an item used in the [[Farming]] skill to reduce the chance of a farming patch becoming [[Disease (Farming)|diseased]] per growth stage by 50 %{{CiteTwitter|author=Mod Kieren|url=https://twitter.com/JagexKieren/status/906202229677359104|date=7 September 2017|archiveurl=https://archive.is/Mn5cf|archivedate=28 May 2020|quote=So with the release of [[Ultracompost]] I figured I'd explain how compost affects crops dying. Sorry it is very word heavy! Fire any questions:)}}. When used on a farming patch, each bucket grants 18 Farming experience.

It also increases the minimum yield and maximum number of harvests received from [[allotment]]s, [[hops]] and [[herb]]s{{CiteTwitter|author=Mod Ash|url=https://twitter.com/JagexAsh/status/1088561370432487424|date=24 January 2019|archiveurl=https://archive.is/nNpNA|archivedate=28 May 2020|quote=[Flower/berry/cactus patches] don't depend on the compost state. Allotments, hops and herbs do.}}. The minimum number of herbs per harvest increases to 4.{{CiteTwitter|author=Mod Ash|url=https://twitter.com/JagexAsh/status/1131004000256630791|date=22 May 2019|archiveurl=https://archive.is/QGaZn|archivedate=21 September 2021|quote=4 for standard compost, 5 for super compost, 6 for the ultra one.}} This also applies to [[giant seaweed]] patches [[underwater]]{{CiteTwitter|author=Mod Ash|url=https://twitter.com/JagexAsh/status/1019207794350845953|date=72 July 2018|archiveurl=https://archive.is/ZcKoV|archivedate=28 May 2020|quote=[Does compost increase giant seaweed yield?] Yeah.}} and [[celastrus bark]] from a fully grown [[celastrus seed]]{{CiteTwitter|author=Mod Ash|url=https://twitter.com/JagexAsh/status/1088630402284224512|date=24 January 2019|archiveurl=https://archive.is/LeHQ1|archivedate=28 May 2020|quote=Yes, celastrus would be helped by composting.}}.

Compost can be upgraded into [[supercompost]] by using one dose of [[compost potion]] on either a bucket of regular compost, or a [[compost bin]] filled with regular compost. It can then be upgraded further into [[ultracompost]] by using 25 [[volcanic ash]] on the bin of [[supercompost]].

==Uses==
Three buckets of compost can be used as payment for a farmer to watch over [[barley seed]]s as they grow, or two buckets for [[potato seed]]s.

Compost is also an ingredient used in creating [[sulphurous fertiliser]], along with [[saltpetre]], to gain [[Hosidius]] [[favour]]. 5.0% Hosidius favour is required to create sulphurous fertiliser.

